import "../../fonts.css";
import "./elevatorPitch.css";

const ElevatorPitch = (() => {
    return (
        <div className="elevatorPitch">
            <h1>
                <span className="cursive">E</span> <span className="pixel">LEVATOR PITCH</span>
            </h1>

            <div>
                <h2 className="pixel">ME AT A GLANCE</h2>
                <ul className="pixel">
                    <li>aspiring webdev (or as i like to say it, a maker of tiny virtual universes) with a solid foundation in object oriented programming</li>
                    <li></li>
                </ul>
            </div>

            <div>
                <h2 className="pixel">MY TECH STACK</h2>
            </div>

            <div>
                <h2 className="pixel">MY LINKS</h2>
            </div>

        </div>
    )
});

export default ElevatorPitch;
